import React from 'react';
import './TabelaUsuarios.css';  
import logo from './IterLogo.png';  

function TabelaUsuario() {
//   const usuarios = [
//     { id: 1, nome: 'Carol Neponucena', email: 'carol.neponucena@gmail.com', endereco: 'Rua Neves Paulista, 7', telefone: '11962761704', cartoes: '2' },


//   ];
const usuarios = fetch('https://itermob-back.onrender.com/v1/itermob/usuario', {
    method: 'GET',  // Confirmando que o método é GET
    headers: {
      'Accept': 'application/json',
      'Content-Type': 'application/json',
    },
  });

  return (
    <div className="usuario-management-container">
      <img src={logo} alt="Logo" className="logo" />     

      <div className="usuario-management-card">
        <h2>GERÊNCIA DE USUÁRIOS</h2>
        
        <table className="usuario-table">
          <thead>
            <tr>
              <th>ID</th>
              <th>Nome</th>
              <th>Email</th>
              <th>Endereço</th>
              <th>Telefone</th>
              <th>Cartões</th>
            </tr>
          </thead>
          <tbody>
            {usuarios.map(usuario => (
              <tr key={usuario.id}>
                <td>{usuario.id}</td>
                <td>{usuario.nome}</td>
                <td>{usuario.email}</td>
                <td>{usuario.endereco}</td>
                <td>{usuario.telefone}</td>
                <td>{usuario.cartoes}</td>
              </tr>
            ))}
          </tbody>
        </table>
      </div>

      <footer>
        <p>Copyright 2024 © IterMob</p>
      </footer>
    </div>
  );
}

export default TabelaUsuario;
